    data: |
      SELECT DISTINCT - 14 * - ( - col0 ) - - col2 * + col2 + - col2 * + 2 * - - col2 + + col0 AS col2, + col2 AS col0 FROM tab0 AS cor0;
  - name: tab0

outputs:
  - name: q7.out
    data: |
      -11062	99
      -1231	10
      -2404	47
